/* ===========================
   3) Utilidades
   =========================== */
function escapeHtml(s='') {
  return String(s).replace(/[&<>"']/g, m => (
    { '&':'&amp;','<':'&lt;','>':'&gt;','"':'&quot;',"'":'&#39;' }[m]
  ));
}

/* ===========================
   4) Render del resultado
   =========================== */
const resultBox = document.getElementById('resultBox');

function renderResult(codeInput) {
  const key = String(codeInput || '').trim().toUpperCase();
  const entry = CODES[key];

  // Evaluaci√≥n de estado
  const ok = !!(entry && entry.habilitado && entry.estado === 'ADMITIDO');
  const statusText = ok ? 'ADMITIDO' : 'NO ADMITIDO';

  // L√≠neas adicionales
  const idHtml     = entry?.id     ? `<p class="meta"><strong>Identificaci√≥n:</strong> ${escapeHtml(entry.id)}</p>` : '';
  const nombreHtml = entry?.nombre ? `<p class="meta"><strong>Nombre:</strong> ${escapeHtml(entry.nombre)}</p>`     : '';

  resultBox.className = 'result ' + (ok ? 'ok' : 'bad');
  resultBox.innerHTML = `
    <h2>${statusText}</h2>
    <p class="code"><strong>C√≥digo:</strong> ${escapeHtml(key || '‚Äî')}</p>
    ${idHtml}
    ${nombreHtml}
    <p class="muted">(DEMO) ${ok ? 'Autorizado' : 'No autorizado'}.</p>
  `;
  resultBox.classList.remove('hidden');
}

/* ===========================
   5) Eventos de la vista p√∫blica
   =========================== */
const codeInput = document.getElementById('codeInput');
const btnVerify = document.getElementById('btnVerify');

btnVerify.addEventListener('click', () => renderResult(codeInput.value));
codeInput.addEventListener('keydown', e => {
  if (e.key === 'Enter') {
    renderResult(codeInput.value);
  }
});

/* ===========================
   6) Tabs (p√∫blico / admin)
   =========================== */
const btnPublic   = document.getElementById('btnPublic');
const btnAdmin    = document.getElementById('btnAdmin');
const publicView  = document.getElementById('publicView');
const adminView   = document.getElementById('adminView');
const sessionLbl  = document.getElementById('sessionLabel');

function showPublic() {
  btnPublic.classList.add('active');
  btnAdmin.classList.remove('active');
  publicView.classList.remove('hidden');
  adminView.classList.add('hidden');
  sessionLbl.textContent = 'Sesi√≥n p√∫blica (DEMO)';
}
function showAdmin() {
  btnAdmin.classList.add('active');
  btnPublic.classList.remove('active');
  publicView.classList.add('hidden');
  adminView.classList.remove('hidden');
  sessionLbl.textContent = 'Sesi√≥n administrador';
}

btnPublic.addEventListener('click', showPublic);
btnAdmin.addEventListener('click', showAdmin);

/* ===========================
   7) Login simple de administrador
   =========================== */
const loginBox  = document.getElementById('loginBox');
const panelBox  = document.getElementById('panelBox');
const adminUser = document.getElementById('adminUser');
const adminPass = document.getElementById('adminPass');
const btnLogin  = document.getElementById('btnLogin');
const btnLogout = document.getElementById('btnLogout');

const ADMIN_USER = 'admin';
const ADMIN_PASS = 'Asd15@'; // <- credenciales (no se muestran en UI)

btnLogin.addEventListener('click', () => {
  if (adminUser.value.trim() === ADMIN_USER && adminPass.value === ADMIN_PASS) {
    loginBox.classList.add('hidden');
    panelBox.classList.remove('hidden');
    fillCodesTable();
  } else {
    alert('Credenciales incorrectas');
  }
});

btnLogout.addEventListener('click', () => {
  panelBox.classList.add('hidden');
  loginBox.classList.remove('hidden');
  showPublic();
});

/* ===========================
   8) Tabla simple (solo lectura)
   =========================== */
const tbody = document.getElementById('codesBody');

function fillCodesTable() {
  tbody.innerHTML = '';
  Object.entries(CODES).forEach(([code, info]) => {
    const tr = document.createElement('tr');
    tr.innerHTML = `
      <td>${escapeHtml(code)}</td>
      <td>${escapeHtml(info.estado)}</td>
      <td>${info.habilitado ? 'S√≠' : 'No'}</td>
      <td>${escapeHtml(info.id || '')}</td>
      <td>${escapeHtml(info.nombre || '')}</td>
    `;
    tbody.appendChild(tr);
  });
}

/* Vista por defecto */
